import React from 'react';
import Card from './Card';


const MapCard = (value) => {
    console.log('brand check' , value.category);
    if(value.category == 'tshirt'){
        return console.log("ye tshirt hai")
    }
   return( <Card 
        imgsrc={value.imgsrc}
        brand = {value.brand} 
        detail = {value.detail}
        price={value.price}
    /> );


};

export default MapCard;
